import logo from './white_main_clean.svg';
import './App.css';
import Header from './Header';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <p>Bu bir ana içerik alanıdır.</p>
      </main>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>We're renewing</p>
        <p>
          Visit us{' '}
          <a
            className="App-link"
            href="https://www.thebadger.house/"
            target="_blank"
            rel="noopener noreferrer"
          >
            from old site
          </a>
        </p>
      </header>
    </div>
  );
}

export default App;
